import React from "react";

class SongList extends React.Component {
  state = {
    songs: [
      {
        title: "Perfect",
        artist: "Ed Sheeran",
        link: "https://www.youtube.com/watch?v=emcFmUm5jtQ",
      },
      {
        title: "There is moonshine",
        artist: "Bill Night",
        link: "https://www.youtube.com/watch?v=CYT2z11j-f8",
      },
      {
        title: "Far to Good",
        artist: "John Smith",
        link: "https://www.youtube.com/watch?v=UBczT73O8sg",
      },
    ],
  };

  render() {
    const usersOnline = this.state.songs.filter(user => user.online == true); 
    const renderOnline = usersOnline.map((i) => <li key={i.artist + 1}>{i.artist}</li>)
    return (
      <div>
        <h3>Song List 1</h3>
        <ul>
          {this.state.songs.map((item) => {
            return <li>{renderOnline}</li>
          })}
        </ul>
      </div>
    )
  }
}

export default SongList;
